import { Component, OnInit } from '@angular/core';


@Component({
  selector: 'app-home',
  templateUrl: './home.page.html',
  styleUrls: ['./home.page.scss'],
})
export class HomePage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}

<ion-content [fullscreen]="true">
  <div class="contendor">
    <div class="logo">
      <ion-img src="../../../assets/RegisterAPPlogo.svg" alt="Logo de la aplicación"></ion-img>
    </div>
    <div class="menu">
      <button mat-button [matMenuTriggerFor]="menu">Menu</button>
      <mat-menu #menu="matMenu" yPosition="below">
        <button mat-menu-item>Item 1</button>
        <button mat-menu-item>Item 2</button>
      </mat-menu>
    </div>
  </div>
  <div class="contendor">
    <div class="navbar">
      <h1>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quo harum eaque aspernatur animi! Facilis veritatis corrupti, nostrum perspiciatis, repudiandae esse asperiores iure eius pariatur sapiente dolor ducimus natus? Tempore corrupti aperiam laborum at cum voluptatibus nobis ut vitae officiis adipisci.</h1>
    </div>
  </div>
</ion-content>
